er being made , understand English or they need not to work at a drive thru                                                           \n","6 I work for door dash and they locked us all out to wait in a long line for no reason at 10. I tried to beg them to open it because I'm door dash and they refused.  Covid is over get a new job                                                                                                                                                                                    \n","  rating \n","1 1 star \n","2 4 stars\n","3 1 star \n","4 5 stars\n","5 1 star \n","6 1 star "]},"metadata":{},"output_type":"display_data"}],"source":["## Reading the McDonald_s_Reviews.csv file\n","McReviews <- read_csv(\"/kaggle/input/mcdonalds-store-reviews/McDonald_s_Reviews.csv\")\n","\n","head(McReviews)"]},{"cell_type":"markdown","id":"2720ad59","metadata":{"papermill":{"duration":0.011009,"end_time":"2023-12-26T16:41:36.43768","exception":false,"start_time":"2023-12-26T16:41:36.426671","status":"completed"},"tags":[]},"source":["# 2 - Cleaning the data, tokenizing and removing stop words"]},{"cell_type":"code","execution_count":3,"id":"e83da43d","metadata":{"_kg_hide-input":false,"execution":{"iopub.execute_input":"2023-12-26T16:41:36.464648Z","iopub.status.busy":"2023-12-26T16:41:36.462419Z","iopub.status.idle":"2023-12-26T16:41:40.054125Z","shell.execute_reply":"2023-12-26T16:41:40.051723Z"},"papermill":{"duration":3.608128,"end_time":"2023-12-26T16:41:40.056851","exception":false,"start_time":"2023-12-26T16:41:36.448723","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<style>\n",".list-inline {list-style: none; margin:0; padding: 0}\n",".list-inline>li {display: inline-block}\n",".list-inline>li:not(:last-child)::after {content: \"\\00b7\"; padding: 0 .5ex}\n","</style>\n","<ol class=list-inline><li><span style=white-space:pre-wrap>'Why does it look like someone spit on my food?\\nI had a normal transaction,  everyone was chill 